// 实现ERC-20标准接口
contract WISA is IERC20, IERC20Metadata, Ownable {
    using SafeMath for uint256;
    // 存储每个地址的余额
    mapping(address => uint256) private _balances;

    // 存储每个地址可操作的地址及其可操作的金额
    mapping(address => mapping(address => uint256)) private _allowances;

    // 代币名称
    string internal _name;

    // 代币符号
    string internal _symbol;

    // 可以有的小数点个数，最小的代币单位
    uint8 internal _decimals;

    // 代币的发行总量
    uint256 private _totalSupply;

    // 矿池合约地址
    address public immutable uniswapV2Pair;
    // 营销钱包地址
    address marketingAccount;
    // 白名单
    mapping(address => bool) private _isExcluded;

    constructor(
        address _swapRouterAddress,
        address _usdtAddress,
        address _marketingAccount
    ) {
        _name = "Wisa";
        _symbol = "WISA";
        _decimals = 18;
        marketingAccount = _marketingAccount;
        _mint(msg.sender, 23300000 * 10**18);
        IUniswapV2Router01 _uniswapV2Router = IUniswapV2Router01(
            _swapRouterAddress
        );
        // Create a uniswap pair for this new token
        uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory())
            .createPair(address(this), _usdtAddress);
        _isExcluded[msg.sender] = true;
    }

    function name() public view virtual override returns (string memory) {
        return _name;
    }

    function symbol() public view virtual override returns (string memory) {
        return _symbol;
    }

    function decimals() public view virtual override returns (uint8) {
        return _decimals;
    }

    //查询Token总量
    function totalSupply() public view virtual override returns (uint256) {
        return _totalSupply;
    }

    //查询某个账户余额
    function balanceOf(address account)
        public
        view
        virtual
        override
        returns (uint256)
    {
        return _balances[account];
    }

    //转账给指定账户
    function transfer(address to, uint256 amount)
        public
        virtual
        override
        returns (bool)
    {
        _transfer(msg.sender, to, amount);

        return true;
    }

    function transferFrom(
        address from,
        address to,
        uint256 amount
    ) public virtual override returns (bool) {
        _spendAllowance(from, msg.sender, amount);
        _transfer(from, to, amount);

        return true;
    }

    function approve(address spender, uint256 amount)
        public
        virtual
        override
        returns (bool)
    {
        _approve(msg.sender, spender, amount);

        return true;
    }

    function allowance(address owner, address spender)
        public
        view
        virtual
        override
        returns (uint256)
    {
        return _allowances[owner][spender];
    }

    function increaseAllowance(address spender, uint256 addedValue)
        public
        virtual
        returns (bool)
    {
        _approve(
            msg.sender,
            spender,
            allowance(msg.sender, spender) + addedValue
        );
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue)
        public
        virtual
        returns (bool)
    {
        uint256 currentAllowance = allowance(msg.sender, spender);
        require(
            currentAllowance >= subtractedValue,
            "ERC20: decreased allowance below zero"
        );
        unchecked {
            _approve(msg.sender, spender, currentAllowance - subtractedValue);
        }

        return true;
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal virtual {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");

        uint256 fromBalance = _balances[from];
        require(
            fromBalance >= amount,
            "ERC20: transfer amount exceeds balance"
        );
        unchecked {
            _balances[from] = fromBalance - amount;
        }
        // 来自交易所合约，扣除0.8的滑点
        uint256 fee = amount.mul(8).div(1000);
        uint256 tAmount = amount;
        if (
            _isExcluded[from] != true &&
            _isExcluded[to] != true &&
            (from == uniswapV2Pair || to == uniswapV2Pair)
        ) {
            tAmount = amount.sub(fee);
            _balances[marketingAccount] = _balances[marketingAccount].add(fee);
            emit Transfer(from, marketingAccount, fee);
        }
        _balances[to] = _balances[to].add(tAmount);

        emit Transfer(from, to, amount);
    }

    function _mint(address account, uint256 amount) internal virtual {
        require(account != address(0), "ERC20: mint to the zero address");

        _totalSupply += amount;
        _balances[account] += amount;

        emit Transfer(address(0), account, amount);
    }

    function _burn(address account, uint256 amount) internal virtual {
        require(account != address(0), "ERC20: burn from the zero address");

        uint256 accountBalance = _balances[account];
        require(accountBalance >= amount, "ERC20: burn amount exceeds balance");
        unchecked {
            _balances[account] = accountBalance - amount;
        }
        _totalSupply -= amount;

        emit Transfer(account, address(0), amount);
    }

    function _approve(
        address owner,
        address spender,
        uint256 amount
    ) internal virtual {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _spendAllowance(
        address owner,
        address spender,
        uint256 amount
    ) internal virtual {
        uint256 currentAllowance = allowance(owner, spender);
        if (currentAllowance != type(uint256).max) {
            require(
                currentAllowance >= amount,
                "ERC20: insufficient allowance"
            );
            unchecked {
                _approve(owner, spender, currentAllowance - amount);
            }
        }
    }

    
    // 白名单设置
    function setExcluded(address account, bool isExcluded) external onlyOwner {
        require(account != address(0), "ERC20: mint to the zero address");

        _isExcluded[account] = isExcluded;
    }
}
